Ext.define("Ext.fx.CubicBezier",{singleton:true,cubicBezierAtTime:function(C,A,B,D,E,F){var H=3*A,G=3*(D-A)-H,J=1-H-G,I=3*B,K=3*(E-B)-I,L=1-I-K;function O(P){return((J*P+G)*P+H)*P}function N(Q,P){var R=M(Q,P);return((L*R+K)*R+I)*R}function M(V,Q){var W,U,P,R,S,T;for(P=V,T=0;T<8;T++){R=O(P)-V;if(Math.abs(R)<Q){return P}S=(3*J*P+2*G)*P+H;if(Math.abs(S)<1e-06){break}P=P-R/S}W=0;U=1;P=V;if(P<W){return W}if(P>U){return U}while(W<U){R=O(P);if(Math.abs(R-V)<Q){return P}if(V>R){W=P}else{U=P}P=(U-W)/2+W}return P}return N(C,1/(200*F))},cubicBezier:function(D,E,A,B){var C=function(F){return Ext.fx.CubicBezier.cubicBezierAtTime(F,D,E,A,B,1)};C.toCSS3=function(){return"cubic-bezier("+[D,E,A,B].join(",")+")"};C.reverse=function(){return Ext.fx.CubicBezier.cubicBezier(1-A,1-B,1-D,1-E)};return C}});